import React from "react";

function Game() {
    var score = 0;
    var topScore = 0;
    return (
        <div>
            <div className="navbar navbar-light bg-light">
                <p className="navbar-brand">Click Game</p>
                <p className="navbar-brand">Click an image to begin</p>
                <p className="navbar-brand">Score: {score} | Top Score: {topScore}</p>
            </div>
        </div>
    );
}

export default Game;
